import React from 'react'
import './s.css'

function Bootstrap() {
  return (
    <div className='container'>
    <div className='row'>
      <div className='col-lg-4 bgred'>
        <h1>Leftside</h1>
      </div>

    </div>
    </div>
  );
}

export default Bootstrap;
